            { name: 'San Diego State', id: 'san-diego-state', record: '6-6' },
            { name: 'Air Force', id: 'air-force', record: '8-4' },
            { name: 'Colorado State', id: 'colorado-state', record: '4-8' },
            { name: 'Wyoming', id: 'wyoming', record: '3-9' }
          ],
          bettingAvailable: true
        }
      ]
    },
    {
      category: 'FCS Featured',
      note: 'Featured in FBS vs FCS matchups with betting lines',
      conferences: [
        {
          name: 'Big Sky',
          id: 'big-sky',
          teams: [
            { name: 'Montana', id: 'montana', record: '10-2' },
            { name: 'Montana State', id: 'montana-state', record: '11-1' },
            { name: 'Northern Arizona', id: 'northern-arizona', record: '6-6' },
            { name: 'Weber State', id: 'weber-state', record: '8-4' }
