    { 
      game: 'Northern Arizona vs Arizona State', 
      week: 1, 
      bettingLine: 'ASU -42.5',
      ourPrediction: 'ASU -38.5',
      edge: '+4.0 pts'
    },
    { 
      game: 'Portland State vs BYU', 
      week: 1, 
      bettingLine: 'BYU -34.5',
      ourPrediction: 'BYU -31.5',
      edge: '+3.0 pts'
    },
    { 
      game: 'Montana State vs Oregon', 
      week: 2, 
      bettingLine: 'Oregon -28.5',
      ourPrediction: 'Oregon -32.5',
      edge: '-4.0 pts'
    }
  ];

  const filteredTeams = (teams) => {
    if (!searchTerm) return teams;
    return teams.filter(team => 
      team.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
  };

  // Handle team click - check if user is logged in
  const handleTeamClick = (team, e) => {
    e.preventDefault();
    if (!user) {
      setSelectedTeam(team);
      setShowLoginPrompt(true);
    } else {
      // User is logged in, navigate to team page
      window.location.href = `/team/${team.id}`;
    }
  };

  // Login Prompt Modal
  const LoginPromptModal = () => {
    if (!showLoginPrompt) return null;

    return (
      <div style={{
        position: 'fixed',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        background: 'rgba(0, 0, 0, 0.8)',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        zIndex: 1000
      }}>
        <div style={{
          background: 'white',
          borderRadius: '20px',
          padding: '40px',
          maxWidth: '500px',
          width: '90%',
          textAlign: 'center',
          color: '#333',
          boxShadow: '0 20px 60px rgba(0,0,0,0.3)'
        }}>
