          }}>
            <h3 style={{ margin: '0 0 15px 0', color: '#2d5016' }}>
              üéØ What You'll Get:
            </h3>
            <div style={{ textAlign: 'left' }}>
              <div style={{ marginBottom: '8px' }}>‚úÖ 54-factor team analysis</div>
              <div style={{ marginBottom: '8px' }}>‚úÖ Player performance predictions</div>
              <div style={{ marginBottom: '8px' }}>‚úÖ Upcoming game breakdowns</div>
              <div style={{ marginBottom: '8px' }}>‚úÖ 92.3% accurate predictions</div>
              <div>‚úÖ 30-day free trial</div>
            </div>
          </div>

          <div style={{
            display: 'flex',
            gap: '15px',
            justifyContent: 'center',
            flexWrap: 'wrap'
          }}>
            <button
              onClick={() => window.location.href = '/register'}
              style={{
                background: 'linear-gradient(45deg, #4CAF50, #45a049)',
                color: 'white',
                border: 'none',
                padding: '15px 30px',
                borderRadius: '25px',
                fontSize: '1.1rem',
                fontWeight: '700',
                cursor: 'pointer',
                transition: 'all 0.3s ease',
                boxShadow: '0 4px 15px rgba(76, 175, 80, 0.4)'
              }}
            >
              üöÄ Start Free Trial
            </button>
            
            <button
              onClick={onSubscriptionClick}
              style={{
                background: 'rgba(45, 80, 22, 0.1)',
                color: '#2d5016',
                border: '2px solid #2d5016',
                padding: '15px 30px',
                borderRadius: '25px',
                fontSize: '1.1rem',
                fontWeight: '700',
                cursor: 'pointer',
                transition: 'all 0.3s ease'
              }}
            >
              üí≥ View Plans
            </button>
          </div>

          <button
            onClick={() => setShowLoginPrompt(false)}
            style={{
              background: 'none',
              border: 'none',
              color: '#666',
              cursor: 'pointer',
              marginTop: '20px',
              fontSize: '0.9rem'
            }}
          >
            Maybe later
          </button>
        </div>
      </div>
    );
  };

