    <div className="enhanced-conference-page">
      {/* Header with Toggle */}
      <div className="conference-header">
        <h1>üèà Complete College Football Coverage</h1>
        <p className="subtitle">
          92.3% Accurate Predictions ‚Ä¢ All 544 Teams ‚Ä¢ 320,000+ Data Points
        </p>
        
        {/* View Toggle */}
        <div className="view-toggle">
          <button 
            className={activeView === 'power4' ? 'active' : ''}
            onClick={() => setActiveView('power4')}
          >
            Power 4 Conferences
          </button>
          <button 
            className={activeView === 'other' ? 'active' : ''}
            onClick={() => setActiveView('other')}
          >
            Other Conferences & Matchups
          </button>
          <button 
            className={activeView === 'search' ? 'active' : ''}
            onClick={() => setActiveView('search')}
          >
            Find Any Team
          </button>
        </div>
      </div>

      {/* Search Bar */}
      <div className="search-section">
        <input
          type="text"
          placeholder="Search any team... (e.g., 'Arizona', 'Northern Arizona', 'Toledo')"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          className="team-search"
        />
      </div>

      {/* Power 4 View */}
      {activeView === 'power4' && (
        <div className="power4-section">
          <div className="conferences-grid">
            {power4Conferences.map((conf) => (
              <div key={conf.name} className="conference-card major" style={{borderColor: conf.color}}>
                <div className="conference-header" style={{backgroundColor: conf.color}}>
                  <span className="conference-icon">{conf.icon}</span>
                  <h3>{conf.name}</h3>
                  <span className="team-count">{conf.teams.length} teams</span>
                </div>
                <div className="teams-grid">
                  {filteredTeams(conf.teams).map((team) => (
                    <div 
                      key={team.id} 
                      className="team-item clickable"
                      onClick={(e) => handleTeamClick(team, e)}
                      style={{ cursor: 'pointer' }}
                      title={user ? `View ${team.name} team page` : `Register to view ${team.name} analysis`}
                    >
                      <div className="team-info">
                        <span className="team-name">{team.name}</span>
                        <span className="team-record">{team.record}</span>
                        <span className="next-game">{team.nextGame}</span>
                      </div>
                      <span className="prediction-indicator">
                        {user ? 'üìä' : 'üîí'}
                      </span>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
          
          {/* Teaser for Other Conferences */}
          <div className="other-conferences-teaser">
            <h3>üîç Also Covering 150+ Additional Teams</h3>
            <p>Group of Five, FCS powerhouses, and all teams with betting lines available</p>
            <button onClick={() => setActiveView('other')} className="explore-button">
              Explore All Teams & Conferences
            </button>
          </div>
        </div>
      )}

      {/* Other Conferences View */}
      {activeView === 'other' && (
        <div className="other-section">
          {/* Featured FBS vs FCS Matchups */}
          <div className="featured-matchups">
            <h2>üéØ Featured Matchups with Betting Lines</h2>
            <p className="section-note">
              These games have active betting markets and generate significant interest
            </p>
            <div className="matchups-grid">
              {featuredMatchups.map((matchup, index) => (
                <div key={index} className="matchup-card">
                  <div className="matchup-teams">{matchup.game}</div>
                  <div className="matchup-details">
                    <span className="week">Week {matchup.week}</span>
                    <span className="betting-line">Line: {matchup.bettingLine}</span>
                    <span className="our-prediction">Our: {matchup.ourPrediction}</span>
                    <span className={`edge ${matchup.edge.startsWith('+') ? 'positive' : 'negative'}`}>
                      Edge: {matchup.edge}
                    </span>
                  </div>
                  <div className="betting-indicator">üìà Betting Available</div>
                </div>
              ))}
            </div>
          </div>

          {/* All Other Conferences */}
          {otherConferences.map((category) => (
            <div key={category.category} className="conference-category">
              <h2>{category.category}</h2>
              {category.note && <p className="category-note">{category.note}</p>}
              
              <div className="conferences-grid">
                {category.conferences.map((conf) => (
                  <div key={conf.name} className="conference-card secondary">
                    <div className="conference-header">
                      <h4>{conf.name}</h4>
                      <div className="betting-status">
                        {conf.bettingAvailable === true && <span className="betting-yes">üí∞ Betting Lines</span>}
                        {conf.bettingAvailable === 'FBS Matchups Only' && <span className="betting-partial">üìä FBS Games</span>}
                      </div>
                    </div>
                    <div className="teams-list">
                      {filteredTeams(conf.teams).map((team) => (
                        <div 
                          key={team.id}
                          className="team-item-small clickable"
                          onClick={(e) => handleTeamClick(team, e)}
                          style={{ cursor: 'pointer' }}
                          title={user ? `View ${team.name} team page` : `Register to view ${team.name} analysis`}
                        >
                          <span className="team-name">{team.name}</span>
                          <span className="team-record">{team.record}</span>
                          <span className="lock-icon">{user ? 'üìä' : 'üîí'}</span>
                        </div>
                      ))}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      )}

      {/* Search View */}
      {activeView === 'search' && (
        <div className="search-results">
          <h2>üîç Find Any Team</h2>
          <p>Search our complete database of 544 college football teams</p>
          
          {searchTerm && (
            <div className="search-results-grid">
              {/* Search through all teams and display results */}
              {power4Conferences.map(conf => 
                filteredTeams(conf.teams).map(team => (
                  <div 
                    key={team.id}
                    className="search-result-card clickable"
                    onClick={(e) => handleTeamClick(team, e)}
                    style={{ cursor: 'pointer' }}
                  >
                    <div className="team-logo-placeholder">
                      {team.name.charAt(0)}
                    </div>
                    <div className="team-details">
                      <h4>{team.name}</h4>
                      <p>{conf.name} Conference</p>
                      <p className="record">{team.record}</p>
                    </div>
                    <span className="view-team">
                      {user ? 'View Team ‚Üí' : 'Register to View üîí'}
                    </span>
                  </div>
                ))
              )}
              
              {/* Also search other conferences */}
              {otherConferences.map(category =>
                category.conferences.map(conf =>
                  filteredTeams(conf.teams).map(team => (
                    <div 
                      key={team.id}
                      className="search-result-card clickable"
                      onClick={(e) => handleTeamClick(team, e)}
                      style={{ cursor: 'pointer' }}
                    >
                      <div className="team-logo-placeholder">
                        {team.name.charAt(0)}
                      </div>
                      <div className="team-details">
                        <h4>{team.name}</h4>
                        <p>{conf.name}</p>
                        <p className="record">{team.record}</p>
                      </div>
                      <span className="view-team">
                        {user ? 'View Team ‚Üí' : 'Register to View üîí'}
                      </span>
                    </div>
                  ))
                )
              )}
            </div>
          )}
        </div>
      )}

      {/* SEO Footer */}
      <div className="seo-footer">
        <h3>Complete College Football Coverage</h3>
